import React, { Component } from 'react';
// import logo from './../logo.svg';
import './App.css';
import { Container, Row, Col, ListGroup, ListGroupItem} from 'reactstrap';

class App extends Component {
  render() {
    return (
      <Container>
        <Row>
          <Col xs="0">
          </Col>

          <Col xs="12" md="12">
            Hello World!
          </Col>

          <Col xs="0">
          </Col>
        </Row>
      </Container>
    );
  }
}

export default App;
